const ings = [
    { value: 'react', label: 'React' },
    { value: 'ng', label: 'Angular' },
    { value: 'svelte', label: 'Svelte' },
    { value: 'vue', label: 'Vue' },
];

export const numIngs = info.map(({ category, drinks }) => drinks).flat(1);

export default ings;
